import React, {useEffect, useState} from 'react';
import useWebSocket from 'react-use-websocket';
import io from "socket.io-client";


import './App.css';
import * as PropTypes from "prop-types";
import Match from "../src/components/websocketHandler";

const socket = io('ws://betlivedemo.oservices.me/ws');

function App() {
	const [notifications, setNotifications] = useState([]);

	useEffect(() => {
		// Listen for incoming notifications from the server
		socket.on("notification", (notification) => {
			setNotifications([...notifications, notification]);
		});

		// Clean up event listeners on unmount
		return () => {
			socket.off("notification");
		};
	}, [notifications]);

	return (
		<div>
			<h1>Live Notifications</h1>
			<ul>
				{notifications.map((notification, index) => (
					<li key={index}>{notification.operatioId}</li>
				))}
			</ul>
		</div>
	);
}

export default  App;
